import React from "react";
import styles from "./Partnershop.module.scss";

const Partnershop = () => {
  return (
    <section className={styles.partnershop}>
      <div className="container">
        <div className={styles.box}>partnershop</div>
      </div>
    </section>
  );
};

export default Partnershop;
